import React, { useEffect, useState } from "react";
import axios from "axios";
import CapitalView from "./CapitalView";

function CapitalComponent() {
  const [capital, setCapital] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("token"); // Asumiendo que guardaste el token aquí al hacer login

    axios
      .get("http://localhost:8080/api/capital", {
        headers: {
          Authorization: `Bearer ${token}`, // Envías el token en el header
        },
      })
      .then((response) => setCapital(response.data))
      .catch((error) => console.error("Error al obtener capital", error));
  }, []);

  return <CapitalView capital={capital} />;
}

export default CapitalComponent;
